import React, { Component } from 'react';
import { v4 as uuid } from 'uuid';
import {
  Box,
  Container,
  makeStyles,
  Button,
  Grid,
  Card
} from '@material-ui/core';
import Page from 'src/components/Page';
import Results from './Results';
import Toolbar from './Toolbar';
import Script from 'react-load-script'
import { Rating } from '@material-ui/lab';
//import data from './data';

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: theme.palette.background.dark,
    minHeight: '100%',
    paddingBottom: theme.spacing(3),
    paddingTop: theme.spacing(3)
  }
}));
//const classes = useStyles();

//customers = []
export default class CustomerListView extends Component {

  constructor(props){
    super(props);
    this.state = {
      customers: [],
      clicked_keyword: "",
      datafeature: [],
      mlacurracy: []
    }
    this.handler = this.handler.bind(this)
  }
  handler(keyword){
    this.setState({
      clicked_keyword: keyword
    })

    fetch('http://localhost:4000/datafeature?keyword='+ keyword)
      .then(response => response.json())
      .then(data => {this.setState({datafeature:data.data})})

      console.log("clicked sds", this)
      //console.log(this.state.datafeature[0])
  }


  //console.log("hello")
  async componentDidMount() {
     fetch('http://localhost:4000/products')
      .then(response => response.json())
      .then(data => {this.setState({customers:data.data.map(
        customer => {
          return{
            id: uuid(),
            rank: customer.rank,
            keyword: customer.keyword,
            gender: customer.gender,
            date_: customer.date_,
            score: customer.score
          } 
        }

      )})})



  }



  render(){
    if(this.state["clicked_keyword"] == ""){
    return (

        <Container maxWidth={false}>
          <Toolbar />
          <Box mt={3}>

            <Results customers={this.state["customers"]} handler={this.handler} clicked_keyword={this.state["clicked_keyword"]} />
            {console.log(this.state["customers"], "keyword:",this.state["clicked_keyword"])}
          </Box>
        </Container>


    );
    }
    else{

      var df = this.state.datafeature[0]
      var rating_mean, rating_rms;
      //5, 15, 25, 35 
      if(df.mean > 35){
        rating_mean = 5;
      } else if(df.mean > 25){
        rating_mean = 4;
      } else if(df.mean >15){
        rating_mean = 3;
      } else if(df.mean >5){
        rating_mean = 2;
      } else{
        rating_mean = 1;
      }
      //2,4,6,8 -rms
      if(df.rms > 8){
        rating_rms = 5;
      } else if(df.rms > 6){
        rating_rms = 4;
      } else if(df.rms >4){
        rating_rms = 3;
      } else if(df.rms >2){
        rating_rms = 2;
      } else{
        rating_rms = 1;
      }


      console.log("re-reder",this.state.datafeature)
      const cardStyle = {
        display: 'block',
        //width: '30vw',
        transitionDuration: '0.3s',
        height: '15vw'
      }

      return(
      <Container maxWidth={false}>
        <Grid
         container
         spacing={5}
         >
           <Grid
              item
              lg={12}
              sm={12}
              xl={12}
              xs={12}
            >
              <Card style={{
                 display: 'block',
                 //width: '30vw',
                 transitionDuration: '0.3s',
                 height: '15vw',
                 backgroundColor: "blue" 
              }}>
                  {this.state.clicked_keyword}
              </Card>
            </Grid>
            <Grid
              item
              lg={12}
              sm={12}
              xl={12}
              xs={12}
            >
              <Card style={cardStyle}>
                  {this.state.datafeature.map(x => {
                    return (<div>
                        <div>{df.mean}</div>
                        <Rating  defaultValue={rating_mean} size="large" />
                    </div>
                    )
                  })}
              </Card>
            </Grid>

            <Grid
              item
              lg={12}
              sm={12}
              xl={12}
              xs={12}
            >
              <Card style={cardStyle}>
                2. 안정성
              </Card>
            </Grid>

            <Grid
              item
              lg={12}
              sm={12}
              xl={12}
              xs={12}
            >
              <Card style={cardStyle}>
                3. 주기성
              </Card>
            </Grid>

            <Grid
              item
              lg={12}
              sm={12}
              xl={12}
              xs={12}
            >
              <Card style={cardStyle}>
                4. 추세
              </Card>
            </Grid>

        </Grid>
      </Container>
      );
    }
  }
};

//export default CustomerListView;
